import React, {Component} from 'react';
import './Dashboard.css'
import Card from 'react-bootstrap/Card';

const Dashboard = () => {
    return (
        <Card>
            <Card.Header as="h5">Featured</Card.Header>
            <Card.Body>
                <Card.Title>Special title treatment</Card.Title>
                <Card.Text>
                   1000
                </Card.Text>
            </Card.Body>
        </Card>
    );
}


